import React, { useEffect, useState } from 'react';
import axios from 'axios';

export const Offers = () => {
    const [parkingData, setParkingData] = useState([]);

    useEffect(() => {
        const fetchParkingData = async () => {
            try {
                const response = await axios.get('http://localhost:5000/parkingform');
                const data = response.data;
                setParkingData(data);
            } catch (error) {
                console.error('Error al obtener los datos de estacionamientos', error);
            }
        };

        fetchParkingData();
    }, []);

    return (
        <div>
            <h1>Plazas de estacionamiento disponibles</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Disponibilidad</th>
                        <th>Parking</th>
                    </tr>
                </thead>
                <tbody>
                    {parkingData.map((parking) => (
                        <tr key={parking.id}>
                            <td>{parking.id}</td>
                            <td>{parking.availabity ? 'Disponible' : 'Ocupado'}</td>
                            <td>{parking.parking}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};
